INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "青空の下で謁見", "フリーマーケット会場", 2, 7, 8, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 20063115, "ペコリーヌとの出会い", 91002, 2834, 0, 10118, 5118061);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "未来の騎空団\nマスコット？", "フリーマーケット会場", 2, 7, 8, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 20063115, "マホとの出会い", 91002, 2835, 0, 10118, 5118062);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "お嬢さまからの\n緊急依頼", "ランドソル市街地", 2, 7, 8, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 20063115, "アキノとの出会い", 91002, 2837, 0, 10118, 5118063);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "黄金色の悩みごと", "フリーマーケット会場", 2, 18, 8, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 20063115, "ジュンとの出会い", 91002, 4108402, 0, 10118, 5118064);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "白熱！　格闘大会！", "フリーマーケット会場", 2, 18, 8, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 20063115, "カオリとの出会い", 91002, 4107402, 0, 10118, 5118065);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "祭り太鼓はオーエドの華", "オーエド町", 2, 16, 8, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 20063115, "ニノンとの出会い", 91002, 9000227, 1, 10118, 5118066);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "人気者は遅れて\nやってくる", "フリーマーケット会場", 3, 19, 8, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 20063115, "スズナとの出会い", 91002, 2101181, 0, 10118, 5118067);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "巫女・ミーツ・魔法少女", "ランドソル市街地", 3, 18, 8, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 20063115, "ナナカとの出会い", 91002, 4109402, 0, 10118, 5118068);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "ネズ耳は二度なくなる", "フリーマーケット会場", 3, 18, 8, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 20063115, "キャル＆コッコロとの出会い", 91002, 4305402, 0, 10118, 5118069);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "この出会いにカンパイ！", "ランドソル市街地", 3, 18, 8, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 20063115, "ユカリとの出会い", 91002, 4101402, 0, 10118, 5118070);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "陰陽アンサンブル", "ランドソル市街地", 3, 18, 8, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 20063115, "アオイとの出会い", 91002, 4106402, 0, 10118, 5118071);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 40, "運試し十番勝負！", "フリーマーケット会場", 3, 7, 8, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 20063115, "シノブとの出会い", 91002, 2836, 1, 10118, 5118072);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (0, 0, "彼女たちの新たな日常", 0, 1, 0, 0, 0, 20063115, "オープニング", 0, 0, 0, 10118, 5118600);
